  false,\n\t\"url\": null,\n\t\"notes\": \"This report contains locations and water
  use at Fish Springs National Wildlife Refuge (NWR) for 2010.  A general background
  is presented on historical spring water data, data records and collection, future
  monitoring needs and long-term datasets.  Data for each diversion/impoundment at
  Fish Springs NWR is supplied.  This data is presented in graphs displaying optimum
  water levels, water levels, and conductivity for each month at every management
  unit. A summary of water management for impoundments is also provided with the water
  use data.  Proposed management and maintenance plans are included in the appendix,
  along with maps of the management units, and a report titled \"Ground-water monitoring
  wells in Fish Springs national Wildlife Refuge, Juab county, Utah\". This Water
  Use Report was created as part of the Annual Habitat Management Plan (AHMP) reporting
  process, and is much more comprehensive than previous water reports.\",\n\t\"owner_org\":
